import React from 'react';

const AuthContext = React.createContext({
    isLoggedIn: false,
    onLogout: () => {},
});

export const AuthContextProvider = props => {
    return <AuthContext.Prodiver>props.childre</AuthContext.Prodiver>;
}

export default AuthContext;
